const Curses = ({curses}) => {
    console.log(curses)
    return (
        <div>
            {curses.map(c => 
                <div>
                    <ul>
                        <li>
                            <h1>{c.name_curses}</h1>
                            <p>{c.name_curses}</p>
                            {c.student.map(s => 
                                <p>{s.name}</p>
                                )}
                        </li>
                    </ul>
                </div>
                )}
        </div>
    )
}


export default Curses;
